import math

def prime_factors(numbers):
    if len(numbers) > 38:
        num = numbers[38]

        factors = set()
        while num % 2 == 0:
            factors.add(2)
            num = num / 2

        for i in range(3,int(math.sqrt(num))+1,2):
            while num % i== 0:
                factors.add(i)
                num = num / i

        if num > 2:
            factors.add(int(num))

        return factors
```
Note: The code assumes that the list 'numbers' is zero-indexed. If the specified index is 38, it actually corresponds to the 39th element in the list.
